package excel

import (
	"encoding/json"
	"github.com/tealeg/xlsx"
	"github.com/vgmdj/utils/logger"
	"strings"
)

type Msg struct {
	Fields FieldInfo `json:"fields"`
}

type FieldInfo struct {
	Cha ChaInfo `json:"cha"`
}

type ChaInfo struct {
	Stat StatInfo `json:"Stat"`
}
type StatInfo struct {
	Request RequestInfo `json:"Request"`
}

type RequestInfo struct {
	IdCode string `json:"IdCode"`
	Name   string `json:"Name"`
}

var List []Msg
var DataMap map[string]string
var jsonStr string
var outFile = "out_user.xlsx"

func JsonToExcel() (err error) {
	// 初始化原始数据
	InitList()
	// 新建文件和sheet
	file := xlsx.NewFile()
	sheet, err := file.AddSheet("sheet1")
	if err != nil {
		logger.Error(err.Error())
		return err
	}
	// 写文件
	for key, info := range DataMap {
		row := sheet.AddRow()
		nameCell := row.AddCell()
		nameCell.Value = key
		ageCell := row.AddCell()
		ageCell.Value = info
	}
	err = file.Save(outFile)
	if err != nil {
		logger.Error(err.Error())
		return err
	}
	logger.Info("write file success")

	return nil
}

func InitList() {
	// 初始化 json
	InitJsonStr()

	// json 转化为 list
	if len(List) == 0 {
		if err := json.Unmarshal([]byte(jsonStr), &List); err != nil {
			logger.Error(err.Error())
		}

	}

	// list 转化为 map (list去重)
	if len(DataMap) == 0 {
		DataMap = make(map[string]string)
		for _, info := range List {
			if _, ok := DataMap[info.Fields.Cha.Stat.Request.Name]; !ok {
				DataMap[info.Fields.Cha.Stat.Request.Name] = info.Fields.Cha.Stat.Request.IdCode
			}
		}
	}

}

func InitJsonStr() {
	if jsonStr == "" {
		newStr := strings.Replace(oldStrTest, "{\"msg\"", ",{\"msg\"", -1)
		tmpStr := strings.Replace(newStr, ",", "", 1)
		tmpStr = strings.TrimRight(tmpStr, ",")
		jsonStr = "[" + tmpStr + "]"
	}
	logger.Info(jsonStr)
}

